INSERT INTO `pit_comments` (`pit_scout_data_id`, `team_number`, `pit_comments`, `id`, `timestamp`) VALUES
(1, 5511, 'Can hit hoppers now, shoot in auto, \"climb in 3 seconds\"', 0, '2017-03-31 22:31:18'),
(2, 6500, 'Slow Low goal Balls, gears, rope climbing 15sec consistent,', 0, '2017-03-31 22:51:30'),
(4, 3196, 'H-drive with omni wheels.', 48, '2017-04-01 16:24:43'),
(5, 6004, 'Tank drive, passive gear mechanism. Climber was broken, but they fixed it. Cheesecakeable.', 48, '2017-04-01 16:28:47'),
(6, 900, 'Swerve drive, no gear mech.', 48, '2017-04-01 16:55:20'),
(7, 4829, 'Tank drive, passive gear mech. Climber bolts on, so if it doesn\'t work we could could easily take it off to cheesecake', 48, '2017-04-01 16:58:16'),
(8, 5679, 'Tank drive, passive gear mech. Electrical was messed up for their second match, but it\'s fixed.', 48, '2017-04-01 17:01:16'),
(9, 2642, '4 CIM drive train, tank-Omni drive, active gear mechanism.', 48, '2017-04-01 17:04:29'),
(10, 6502, 'Mechanum, it climbs (2.5 to 3 sec), gear delivery (passive), 4-6 per game, no shooter', 39, '2017-04-01 20:34:58'),
(11, 587, '6 wheel drop center drive. Dual speed gearboxes. Do not have a Velcro climber.', 54, '2017-04-01 20:36:08'),
(12, 3737, '7second climb\r\nNo ground pickup\r\n3 position auto\r\nShooter\r\nClimber\r\nHolonomic mecanum', 56, '2017-04-01 20:38:53'),
(13, 6729, 'Tank Drive, climbs (7-10 sec), autonomous gear, passive loading system, no shooter, no ground gear intake, does not go for gears in match', 39, '2017-04-01 20:41:19'),
(14, 435, 'Mecanum drive. Active gear system.', 54, '2017-04-01 20:41:22'),
(15, 3459, 'Mecanum drive.', 54, '2017-04-01 20:42:43'),
(16, 587, '6 CIM tank\r\n10 sec climb\r\n4-6 gears a game\r\nFar and center auto\r\nShifters', 56, '2017-04-01 20:45:58'),
(17, 4829, 'Tank drive, passive gear delivery (about 4 a match), climbs (3 sec once it catches), no shooter, no ground gear intake', 39, '2017-04-01 20:46:53'),
(18, 3459, 'No intake \r\n30 sec climb', 56, '2017-04-01 20:50:48'),
(19, 5679, 'Tank drive, climbs (sorta, they are currently making a new climber), passive (doesn\'t work well/bad at catching), no shooter, no ground gear intake', 39, '2017-04-01 20:51:11'),
(20, 5679, 'Tank drive, climbs (sorta, they are currently making a new climber), passive (doesn\'t work well/bad at catching), no shooter, no ground gear intake', 39, '2017-04-01 20:51:12'),
(21, 3459, 'Holonomic\r\nGear mech is usable with ball\r\n30 sec climb \r\n3-5 gears a game\r\nWorking on auto shooter', 56, '2017-04-01 20:55:50'),
(22, 5190, '4 CIM drive, tank\r\n119.1 lbs\r\n30 sec climb\r\nNo ground gear\r\nNo ball intake', 56, '2017-04-01 21:00:55'),
(23, 2682, '6 wheel (4 traction, 2 omni) climbs (fast), passive gear mech, shooter (not used often, fires for high efficiency), no ground intake for gears or fuel', 39, '2017-04-01 21:01:35'),
(24, 900, '20 sec climb\r\nSwerve\r\nGround ball intake \r\nCan drop a gear for alliance partner\r\nApprox 100 balls\r\nClimber\r\nStereoscopic camera\r\nMotion profiling', 56, '2017-04-01 21:08:26'),
(25, 900, '20 sec climb\r\nSwerve\r\nGround ball intake \r\nCan drop a gear for alliance partner\r\nApprox 100 balls\r\nClimber\r\nStereoscopic camera\r\nMotion profiling\r\nIntake issues\r\nNot feeding', 56, '2017-04-01 21:08:39'),
(26, 4935, 'Passive gear\r\n6 CIM single speed \r\nClimber', 56, '2017-04-01 21:11:41'),
(27, 6332, '6 CIM 2 speed tank\r\n30 sec climb\r\nPassive gear mech\r\nCan shut out 900\r\nIffy climber', 56, '2017-04-01 21:18:19'),
(28, 1533, 'Gear intake is weak\r\n20 sec\r\nBall intake \r\nTiebreaker kpa\r\nBall auto \r\nGear auto center\r\nSwerve drive', 56, '2017-04-01 21:24:11'),
(29, 2059, 'Mechanum drive and active gear mech.', 48, '2017-04-01 21:31:23'),
(30, 5854, 'Mecanum. Active gear mech, but it can be used as passive', 48, '2017-04-01 21:34:21'),
(31, 2655, 'Mecanum drive, active gear mechanism.', 48, '2017-04-01 21:36:46'),
(32, 2640, 'Tank drive, active gear mech, ~100lbs', 48, '2017-04-01 21:40:20'),
(33, 3196, 'H drive\r\nPassive  gear mech\r\n30 sec climb\r\nMiddle gear auto\r\nTemperamental\r\nBall auto\r\n4 avg\r\nBall tiebreaker', 56, '2017-04-01 21:45:16'),
(34, 2655, '15/ 20 seconds. Climber', 56, '2017-04-01 21:46:56'),
(35, 5511, 'Two speed tank drive. Active gear mech.', 48, '2017-04-01 21:48:04'),
(36, 5054, 'Should be glitch, 5854', 56, '2017-04-01 21:51:46'),
(37, 435, 'Active gear mech\r\nMechanum\r\n85 lbs\r\n15 sec climb\r\nNo balls\r\nCenter gear auto, right gear auto in December\r\n4-6 gears in teleop', 56, '2017-04-01 22:02:07'),
(38, 6565, 'Tank drive. No gear mechanism. Climber not working as of now.', 33, '2017-04-01 22:33:52'),
(39, 4561, '6 wheel pneumatics drive, they say 80 percent accuracy shooter, active gear mechanism, they claim 3-4 seconds to climb', 53, '2017-04-01 22:36:30'),
(40, 4561, '6 Cin tank drive. Active gear mechanism. Has shooter.', 33, '2017-04-01 22:36:58'),
(41, 5544, 'Mecanum drive, total climb 8 to 10 seconds, passive gear mechanism, no shooter.', 53, '2017-04-01 22:42:14'),
(42, 3229, '6 wheel tank drive, no shooter, passive gear, 15 to 16 seconds climber', 53, '2017-04-01 22:45:43'),
(43, 5160, 'Mecanum drive, 2 second climber with redundant motors, active/passive gear mechanism no shooter.', 53, '2017-04-01 22:52:20'),
(44, 5854, 'Best picture I could get', 53, '2017-04-01 22:54:25'),
(45, 6639, 'Tank drive, no shooter, 5 sec climbing speed, passive gear mech', 53, '2017-04-01 23:02:23'),
(46, 3402, 'Mecanum, passive gear mechanism, 12 to 15 sec climbing and no shooter', 53, '2017-04-01 23:08:35');
